import React from "react";

const Table = (props) => {
    if (props.data.length > 0) {
        return <>
            <table>
                <thead>
                    <tr>
                        {
                            Object.keys(props.data[0]).map(title => <>
                                <th key={title}>
                                    {title}
                                </th>
                            </>)
                        }
                    </tr>
                </thead>
                <tbody>
                    {props.data.map(row=>console.log(row))}
                    {
                        Objectprops.data.map(row => <>
                            <tr key={row.id}>
                                {
                                    row.map((r, i) => <>
                                        <td key={r + i}>
                                            {r}
                                        </td>
                                    </>)
                                }
                            </tr>
                        </>)
                    }
                </tbody>
            </table>
        </>
    }
}


export default Table
